import React from "react";
import { Routes, Route } from "react-router-dom";
import Home from "./Home";
import FAQPage from "src/FAQPage";


export default function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/faq" element={<FAQPage />} />
    </Routes>
  );
}
